import React from 'react';
import logo from '../../assets/images/Logo.png';
import './Header.css';

function Header() {
  const handleDotClick = (index) => {
    // Handle logic to change carousel image based on index
    // You can implement your own logic here
    console.log(`Clicked dot ${index}`);
  };

  return (
    <header>
      <nav id="navbar">
        <ul>
          <li><a href="#home">Home</a></li>
          <li><a href="#schedule">Schedule</a></li>
          <li><a href="#program">Programs</a></li>
          <li><a href="#events">Events</a></li>
          <li><a href="#news">News</a></li>
          <li><a href="#merch">Merch</a></li>
          <li><a href="#contactus">ContactUs</a></li>
          <li><img src={logo} alt="Logo" /></li>
          {/* Dot buttons for carousel control */}
          <li><button onClick={() => handleDotClick(1)}>•</button></li>
          <li><button onClick={() => handleDotClick(2)}>•</button></li>
          <li><button onClick={() => handleDotClick(3)}>•</button></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
